import { FastField, Form } from "formik";
import React, { useState } from "react";
import { useEffect } from "react";

export const SwitchCheckBox = ({ label, name, getAttToEdit , customClass}) => {
  return (
    <div className={`${customClass} form-check form-switch`}>
      <span>{label}</span>
      <FastField id={name} name={name} type="checkbox" className="form-check-input pointer" />
    </div>
  );
};

